import Header from '../component/header';

const AdditionalLinks = props => (
	<li>
		<Link href={'/post?title=${props.title}'}>
			<a>{ props.title }</a>
		</Link>
	</li>
);

const Index = () => (
	<div>	
		<Header />	
		<main>
			<h2>Hello buddy!</h2>
			<ul>

			</ul>
		</main>
	</div>
);

export default Index;
